import { weeklyPopular } from "../../data"

export default function Dashboard(){

    // temp mapping for "popular this week"
    const weeklyPopularMapped = weeklyPopular.map(i=>(
        <div key={i.name}
        className="h-[18rem] flex-1 min-w-[13rem] p-4 border-2 bg-secondary">
            <h1 className="text-4xl font-bold text-black/70 break-words hyphens-auto">{i.name}</h1>
        </div>
    ))

     // temp mapping for "popular among friends"
    const friendsPopularMapped = weeklyPopular.map(i=>(
        <div key={i.name}
        className="h-[18rem] flex-1 min-w-[6rem] p-4 border-2 bg-secondary">
            <h1 className="text-4xl font-bold text-black/70 break-words hyphens-auto">{i.name}</h1>
        </div>
    ))
    return(

        <div className="w-full max-w-[55rem]
        flex flex-col gap-6 md:gap-20">
            {/** ---- Popular this week ---- */}
            <section className="flex flex-col gap-4">
                <p>Popular this week</p>
                <div className="w-full
                flex flex-row gap-4 overflow-x-scroll
                ">
                    {weeklyPopularMapped}
                </div>
            </section>



            {/** ---- popular among friends ---- */}
            <section>
                <p>Popular among friends</p>
            </section>
        </div>
    )
}
